import { useNavigate } from 'react-router-dom';
import { HugeiconsIcon } from '@hugeicons/react'; // Make sure this import works with your setup

const inspections = [
  { title: 'Canteen Inspection', formPath: '/form/canteen', icon: 'Store01' },
  { title: 'Fuel Storage Tank Inspection Checklist', formPath: '/form/fuel', icon: 'GasStation' },
  { title: 'Hand and Power Tool Inspection Form', formPath: '/form/hand-and-power', icon: 'Tools' },
  { title: 'PPE Inspection Form', formPath: '/form/ppe', icon: 'SafetyVest' },
  { title: 'Science Laboratory Inspection Form', formPath: '/form/science-laboratory', icon: 'Flask01' },
  { title: 'Swimming Pool Inspection Checklist', formPath: '/form/swimming-pool', icon: 'Swimmer' },
  { title: 'Vehicle Inspection Form', formPath: '/form/vehicle', icon: 'Truck01' },
];

export default function InspectionDashboard() {
  const navigate = useNavigate();

  return (
    <div className="p-6" style={{ backgroundImage: "url('/image.png')" }}>
      <h1 className="text-3xl font-bold mb-6">Inspection Forms</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
        {inspections.map((item, idx) => (
          <div
            key={idx}
            onClick={() => navigate(item.formPath)}
            className="cursor-pointer border border-gray-300 p-5 rounded-md shadow-md hover:bg-primary hover:text-white transition duration-200 flex items-center gap-4"
          >
            <HugeiconsIcon name={item.icon} className="w-8 h-8 text-primary" />
            <h2 className="text-lg font-semibold">{item.title}</h2>
          </div>
        ))}
      </div>
    </div>
  );
}
